import logo from './logo.svg';
import './App.css';
import NavBar from './NavBar';
import Header from './Header';
import Second_page from './Second_page';
import Thired_page from './Thired_page';
function App() {
  return (
    <div className="App">
     <NavBar/>
     <Header/>
     <Second_page/>
     <Thired_page/>
    </div>
  );
}

export default App;
